    function(err) {
      if(err){
        console.log('somethin went wrong');
      }
    }
  );
  }
  render(){
   return ( 
    <div className="App">
    <Particles className ='particles'
        params={particlesOption}
         />
       <Navigation />
         <Logo />
          <Rank />
         <ImageLinkForm 
            onInputChange = {this.onInputChange} 
            onButtonSubmit = {this.onButtonSubmit }/>
         {/*
         <FaceRecognition/> */}
    </div>
    );
  }
}

export default App;
